import { ASSET_BASE_URL, ASSET_CATEGORY } from "../Constant";
const { GAMEOBJECT, MESH, GUI, LIGHT, CAMERA, EMPTY } = window.BabylonConstant;

class AssetLibrary {
  constructor() {
    this.assets = {};
  }

  getPureFileName(fullFileName) {
    const extensionIndex = fullFileName.lastIndexOf(".");
    return fullFileName.substring(0, extensionIndex);
  }

  loadAssetsFor(category, onload) {
    let assets = this.getAssetsFor(category);

    if (!assets) {
      const defaultAssets = this.getDefaultAssets(category);
      const loadedAssets = this.getLoadedAssets(category); // todo
      assets = defaultAssets.concat(loadedAssets);
      this.assets[category] = assets;
    }

    if (onload) {
      onload(assets);
    } else {
      return assets;
    }
  }
  getAssetsFor(category) {
    return this.assets[category];
  }
  getAssetFor(id, category) {
    const assets = this.loadAssetsFor(category);
    if (assets) {
      const asset = assets.find(asset => asset.assetId === id);
      return asset;
    } else {
      return null;
    }
  }

