          asset.category = ASSET_CATEGORY.CHARACTER;
          asset.path = ASSET_BASE_URL + asset.path;
          asset.thumbPath = ASSET_BASE_URL + asset.thumbPath;
          if (asset.texture) asset.texture = ASSET_BASE_URL + asset.texture;
