  getCubbixCharactersAssets() {
    const fileNames = [];
    for (let i = 0; i <= 20; i++) {
      if (i === 4) continue;
      fileNames.push(`cubbix-character-${i}.obj`);
    }
    const assets = fileNames.map((fileName, i) => {
      const pureFileName = this.getPureFileName(fileName);
      return {
        type: GAMEOBJECT.MESH,
        subtype: MESH.OBJ,
        name: pureFileName,
        path: `/objs/cubbix-characters/`,
        filename: fileName,
        position: { x: 0, y: 0, z: 0 },
        rotation: { x: 0, y: 0, z: 0 },
        scale: { x: 1, y: 1, z: 1 },
        thumbPath: `/thumbs/cubbix-characters/${pureFileName}.png`
      };
    });
    return assets;
  }
